import React from 'react'
import icon from '../Static/Images/otter-icon.png'

export default function Dashboard() {
    return (
        <div className="container-fluid"> {/* Start of container */}
            <div className="row">
                <div className="col-sm-3 vh-100" id="dashboard-col-left">
                    <img src={icon} alt="Otter" className="mt-1" id="dashboard-icon"/>
                </div>
                <div className="col-sm-6" id="dashboard-col-mid"></div>
                <div className="col-sm-3" ></div>
            </div>
        </div> //End of container
    )
}
